  false,\n\t\"url\": null,\n\t\"notes\": \"From 1990 to 1993 three National Wildlife
  Refuges (NWRs) located west of the Missouri River in North Dakota were surveyed
  for contaminants. Trace element concentrations were determined in water, sediment,
  fish, and bird tissues collected from Stewart Lake, White Lake, and Lake Ilo NWRs.
  Selenium levels in young-of-the-year waterfowl livers from Stewart Lake ranged from
  4.3 to 40 ug/g dry wt., with a mean of 18.5. This concentration is considered elevated.
  Waterfowl livers from White Lake and Lake Ilo were not elevated. Selenium in 41
  eared grebe (Podiceps nigrico11is) eggs, from Stewart Lake NWR averaged 4.5 ug/g
  dry weight (range 2.9-6.5 ug/g), and is above the 85th percentile of mean concentrations
  in background investigations of selenium in eggs from the western United States.
  All other contaminant concentrations were within normal ranges. Management strategies
  to improve water quality and reduce erosion would be beneficial to Stewart Lake
  NWR.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
